"Historia stanu wiadomości pokazuje bezpośrednie i pośrednie działania oraz błędy powiązane z problemem:

 • sekwencję zdarzeń, które spowodowały wystąpienie błędu;
 • oś czasu ze zdarzeniami oraz czas pomiędzy nimi;
 • historię zdarzeń, na przykład wiadomość, której nie można wysłać lub dostarczyć;
 • co stało się z wysłaną lub odebraną wiadomością przed wystąpieniem problemu i po nim;
 • różnice między treścią odebranej wiadomości a treścią wyświetloną przez adresata;
 • przerwy w połączeniu Wi-Fi, połączeniu do transmisji danych i innych połączeniach;
 • jaki wpływ miała problematyczna wiadomość na inne wiadomości lub całą rozmowę."

"Twój niezmieniony numer telefonu może uwidocznić niektóre problemy powiązane z wysyłaniem i odbieraniem wiadomości, na przykład:

 • niezamierzone zmiany w prefiksie numeru telefonu lub formacie lokalnych i międzynarodowych numerów telefonów;
 • problemy powiązane z Twoim numerem telefonu;
 • problemy z połączeniem Wi-Fi, połączeniem do transmisji danych i innymi połączeniami związane z protokołem Rich Communication Services (RCS).

Twój numer telefonu jest używany tylko do rozwiązywania problemów. Google nie będzie kontaktować się z Tobą ani innymi osobami korzystającymi z tego numeru telefonu."
